import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import MainPage from "./components/pages/MainPage/MainPage.jsx";
import './styles/app.css';
import Nike from "./components/pages/Nike/Nike.jsx";
import NewBalance from "./components/pages/NewBalance/NewBalance.jsx";
import NikeSB from './components/pages/NikeSB/NikeSB.jsx'
import Jordan from "./components/pages/Jordan/Jordan.jsx";

function App() {
  return (
    <Router>
      <Routes>
        <Route path='/' element={<MainPage/>} />
        <Route path="/brands/nike" element={<Nike />} />
        <Route path="/brands/nike-sb" element={<NikeSB />} />
        <Route path="/brands/new-balance" element={<NewBalance />} />
        <Route path="/brands/jordan" element={<Jordan />} />
      </Routes>
    </Router>
  );
}

export default App;
